import React from "react";
import "./Card.scss";
import Inputs from "./Inputs";

const Card = () => {
  return (
    <section className="todo">
      <section>
        <div className="contenedor-Texto">
          <p></p>
          <table>
            <thead>
              <tbody>
                <td></td>
              </tbody>
            </thead>
            <button>Guardar</button>
          </table>
        </div>
      </section>
    </section>
  );
};

export default Card;
